import React from 'react';
import './header.css';
import Emblem from '../../../media/logo-img.png';
import {Container, Row, Col, Image} from 'react-bootstrap';
import Wave from 'react-wavify'

function header() {
    return (
        <>
        <header className = "header d-flex align-items-end justify-content-center" id = "home">
            <Container>
                <Row>
                    <Col className = "pt-5 d-flex justify-content-center">
                        <Image src = {Emblem} fluid></Image>
                    </Col>
                </Row>   
            </Container>  
        </header>
        <Wave className = "wave" fill='#f79902' options={{height: 20, amplitude: 20, speed: 0.15, points: 3}}></Wave>
        <Wave className = "wave" fill='#28a745' options={{height: 20, amplitude: 30, speed: 0.15, points: 3}}></Wave>
        </>
    )
}

export default header
